--
-- Name: v_investors; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW v_investors AS
    SELECT i.id AS investor_id, c.id AS company_id, i.type_id, t.name AS type_name, c.name, c.full_name, c.place, c.form, c.creation_date, c.contacts, c.description, (SELECT array_to_string(array_agg(l.name), ', '::text) AS array_to_string FROM (locations l JOIN location_bindings lb ON ((((lb.location_id = l.id) AND (lb.entity_id = i.id)) AND ((lb.entity_type)::text = 'Investor'::text))))) AS countries FROM ((companies c JOIN investors i ON (((c.id = i.actor_id) AND ((i.actor_type)::text = 'Company'::text)))) JOIN investor_type t ON ((t.id = i.type_id)));


--
-- Name: v_projects; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW v_projects AS
    SELECT p.id AS project_id, c.id AS company_id, c.name, c.full_name, c.place, c.form, c.creation_date, c.contacts, p.description, (SELECT array_to_string(array_agg(COALESCE(r.name, p.name)), ', '::text) AS array_to_string FROM (((scopes s JOIN project_scopes ps ON (((ps.scope_id = s.id) AND (ps.project_id = p.id)))) LEFT JOIN scopes p ON ((p.id = s.parent_id))) LEFT JOIN scopes r ON ((r.id = p.parent_id)))) AS industries, (SELECT array_to_string(array_agg(s.name), ', '::text) AS array_to_string FROM (scopes s JOIN project_scopes ps ON (((ps.scope_id = s.id) AND (ps.project_id = p.id))))) AS sectors, (SELECT array_to_string(array_agg(l.name), ', '::text) AS array_to_string FROM (locations l JOIN location_bindings lb ON ((((lb.location_id = l.id) AND (lb.entity_id = p.id)) AND ((lb.entity_type)::text = 'Project'::text))))) AS countries FROM (projects p JOIN companies c ON ((c.id = p.company_id)));


--
-- Name: v_deals; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW v_deals AS
    SELECT d.id AS deal_id, p.name AS project_name, COALESCE(d.contract_date, d.announcement_date) AS deal_date, st.name AS status_name, (SELECT array_to_string(array_agg(i.name), ', '::text) AS array_to_string FROM (investments ii JOIN v_investors i ON (((i.investor_id = ii.investor_id) AND (ii.deal_id = d.id))))) AS investor_names, (SELECT array_to_string(array_agg(i.type_name), ', '::text) AS array_to_string FROM (investments ii JOIN v_investors i ON (((i.investor_id = ii.investor_id) AND (ii.deal_id = d.id))))) AS investor_types, (SELECT array_to_string(array_agg(COALESCE(i.place, 'Местоположение не известно'::character varying)), ', '::text) AS array_to_string FROM (investments ii JOIN v_investors i ON (((i.investor_id = ii.investor_id) AND (ii.deal_id = d.id))))) AS investor_places, (SELECT array_to_string(array_agg(COALESCE(i.countries, 'Рынок не известен'::text)), ', '::text) AS array_to_string FROM (investments ii JOIN v_investors i ON (((i.investor_id = ii.investor_id) AND (ii.deal_id = d.id))))) AS investor_countries, (SELECT array_to_string(array_agg(ii.instrument_id), ', '::text) AS array_to_string FROM investments ii WHERE (ii.deal_id = d.id)) AS investment_instruments, p.full_name, p.countries, p.place, p.industries, p.sectors, p.description, s.name AS stage_name, r.name AS round_name, e.name AS exit_type_name, d.amount_usd, d.amount_rub, d.comments FROM (((((deals d JOIN v_projects p ON ((p.project_id = d.project_id))) LEFT JOIN deal_stages s ON ((s.id = d.stage_id))) LEFT JOIN deal_rounds r ON ((r.id = d.round_id))) LEFT JOIN deal_statuses st ON ((st.id = d.status_id))) LEFT JOIN deal_exits e ON ((e.id = d.exit_type_id)));


